// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmPlayer 
} from '@vime/core';

import { define } from '../lib';


define('vm-player', VmPlayer);


export interface PlayerProps extends JSX.VmPlayer, HTMLAttributes<HTMLVmPlayerElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmPlayerElement, PlayerProps>(
  'vm-player',
  new Set(['logger','theme','icons','paused','playing','duration','mediaTitle','currentProvider','currentSrc','currentPoster','currentTime','autoplay','ready','playbackReady','loop','muted','buffered','playbackRate','playbackRates','playbackQuality','playbackQualities','seeking','debug','playbackStarted','playbackEnded','buffering','controls','isControlsActive','isSettingsActive','volume','isFullscreenActive','aspectRatio','viewType','isAudioView','isVideoView','mediaType','isAudio','isVideo','isLive','isMobile','isTouch','isPiPActive','textTracks','currentTextTrack','isTextTrackVisible','shouldRenderNativeTextTracks','audioTracks','currentAudioTrack','autopause','playsinline','language','translations','languages','i18n']),
);
